import React from 'react';
import trashSVG from '../../assets/trash.svg';

const Trash = (props: any) => {
  return(
    <React.Fragment>
      <img src={trashSVG} className="trash-button" id="caret" alt="caret-here" />
    </React.Fragment>
    )
}

export default Trash;
